eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"danceFormsLists\", function() { return danceFormsLists; });\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"userData\", function() { return userData; });\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"navigation\", function() { return navigation; });\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"dashboardNav\", function() { return dashboardNav; });\nvar danceFormsLists = [{\n  id: 1111,\n  imageSrc: 'ballet-dance',\n  name: 'Ballet Dance',\n  bio: 'Ballet dance has its origin from Italy. The term ballet means to â€œdance.â€ This is usually accepted all over the world as one of the most artistic forms of entertainment enjoyed by all ages. This Dance is the combination of choreography and art, scenic design, lighting, costume, graceful movements with light classical music. These days the traditional ballet dance is replaced with new modern forms of ballet dance styles. Some of the forms of ballet dance are classical ballet, contemporary ballet, neoclassical ballet etc. This type of Dance is not difficult to learn once you have identified your passion for it.'\n}, {\n  id: 1113,\n  imageSrc: 'kathak-dance',\n  name: 'Kathak Dance',\n  bio: 'In types of Indian Dance, Kathak is one which originated in the north Indian land. Among the many dance name list, Kathak is one beautiful form of art. Nomadic bards of ancient Northern India are known to lay down the foundation of this dance form. They were known as storyteller or Kathakars. The performers usually wear the famous Lehenga Choli costume while dancing. Even the copper bells used in Bharatnatyam are used in this dance form.'\n}, {\n  id: 1114,\n  imageSrc: 'break-dance',\n  name: 'Break Dance',\n  bio: 'Breakdance also knew as a street dance was originated by Puerto Rican Youths and African Americans. This dance form consists of four major movements â€“ power moves, down rock, top rock and freezes. This is a modern kind of Dance that involves abstract body steps, that may or may not convey anything. It is usually practiced by the youth.'\n}, {\n  id: 1115,\n  imageSrc: 'lion-dance',\n  name: 'Lion Dance',\n  bio: 'The lion dance is the traditional dance form of Chinese culture. In this form of dance, the performers wear lion costumes and mimic the moves and styles of a lion. This type of Dance is amazing to look at and is completely different from another dance form because you usually cannot see the person behind the costume in this form.'\n}, {\n  id: 1116,\n  imageSrc: 'tap-dance',\n  name: 'Tap Dance',\n  bio: 'In this dance form, one needs to tap the shoes on the wooden floor. The shoes are made up of a metallic sole on the heel and the toe facilitating the tapping sound. The two well-known tap dance types are Broadway tap and Rhythmic tap. Tap dancing is also done in Cappella style in which performers need to perform on music created from tapping.'\n}, {\n  id: 1117,\n  imageSrc: 'salsa-dance',\n  name: 'Salsa Dance',\n  bio: 'It will come in another type of western Dance which almost everyone knows and is performed all around the world. Salsa was originated in New York due to the strong influences of Latin America. Arms are used by the lead dancers to communicate with the followers. In these types of dances, the major expressive movements are done by the lower part of the body that is the hips, the body and legs. The upper body remains at its level. Salsa can be performed in different styles which can be identified on the basis of foot patterns, turns and figures, on the basis of timing, body rolls, dance influence, attitude and the way the partners hold each other while dancing.'\n}, {\n  id: 1118,\n  imageSrc: 'waltz-dance',\n  name: 'Waltz Dance',\n  bio: 'The ballroom couple dance performed in closed positions is known as Waltz. This dance form had originated in the country of England during 1816. Several Victorian novels have the mentioning and a perfect description of this dance form. While dancing, the man is required to clasp his arms around his female partnerâ€™s waist. This type of modern Dance requires performers to execute delicate and fluid moves and Dance to slow melodic music.'\n}, {\n  id: 1119,\n  imageSrc: 'belly-dance',\n  name: 'Belly Dance',\n  bio: 'One of the unique forms of Dance is belly dancing, and it comes under types of modern Dance. It is characterized by sharp and rolling movements of the abdomen and the hips. This dance form has different types of dance moves depending upon the region and country it is being performed. Movements of the hips and the torso communicate the maximum. Shakira, a famous Latin American superstar, was the one to popularize this form during the 2000s.'\n}, {\n  id: 1120,\n  imageSrc: 'swing-dance',\n  name: 'Swing Dance',\n  bio: 'Swing, as the name sounds, is a very interesting dance form. It is a group of dances developed with a swing style danced to the tunes of jazz music during the 1920s â€“ 1950s. Swing is a blanket word to different dances such as Jitterbugs, Boogie Woogie and Lindy hops. This type of dance form is fun, and the performers wear stylish dresses, yet very comfortable.'\n}, {\n  id: 1121,\n  imageSrc: 'aerial-dance',\n  name: 'Aerial Dance',\n  bio: 'Aerial Dance is slowly becoming very famous these days. This dance form is not easy to perform and requires proper training. It was first performed in the USA during the 1970s. The name clearly indicates that in this form, the performer is required to perform in the air. The dancer hangs from any apparatus which is attached to the ceiling and performs steps in mid-air. It provides a lot of space to develop a new idea and dance moves.'\n}, {\n  id: 1122,\n  imageSrc: 'tango-dance',\n  name: 'Tango Dance',\n  bio: 'It is a partner dance originated along with the river Plate during the 1890s the partners in tango follow each other chest to chest with either an open embrace or a closed embrace with a constant touch from the thigh area. Tango is a kind of ballroom dance and began in the working-class port in Uruguay, Argentina and Rio de la Plata.'\n}, {\n  id: 1123,\n  imageSrc: 'disco-dance',\n  name: 'Disco Dance',\n  bio: 'Disco dance is a type of dance style that is a musical style dating to early 1970s. It began from the USA urban night-life scene, where it had been restricted to house parties. From there on, it began making regular mainstream appearances and gathered popularity. Its popularity was achieved sometime during the mid-1970s to the early 1980s.'\n}, {\n  id: 1124,\n  imageSrc: 'folk-dance',\n  name: 'Fold Dance',\n  bio: 'Folk dance is a typical form of Dance that is usually extensively performed in rural areas. It talks of the folklore of the village plight. It is a traditional type of Dance pertaining to one set of people or community. The costumes are interesting and usually depict the traditional dress of the community.'\n}, {\n  id: 1112,\n  imageSrc: 'bharata_Natyam_dance',\n  name: 'BharataNatyam Dance',\n  bio: 'Bharatnatyam is an Indian classical dance form having its origin in Tamil Nadu. It is a dance form practiced by both males and females. It is known among all for its tenderness of graceful expressions and posses and beauty of the dance steps. Dancers wear anklets while performing which consists of numerous copper bells attached. Dancers must excel in the art of perfect ringing of bells in the anklets and must also have proper control over it. Bharatnatyam is one of the well-known types of Dance in India.'\n}, {\n  id: 1125,\n  imageSrc: 'electronic-dance',\n  name: 'Electronic Dance',\n  bio: 'This style of Dance is also known as Electronic Dance Music (EDM). This style started in Northern Europe during the 2000s and has become very popular in the next decades. This Dance is typically performed to electro house music based on different dance styles like disco, hip hop and freehand glow sticking.'\n}];\nvar userData = {\n  emailId: 'joedoe@yopmail.com',\n  password: 'JoeDoe@12345'\n};\nvar navigation = [{\n  name: 'Home',\n  href: '/',\n  current: true\n}, {\n  name: 'Login',\n  href: '/login',\n  current: false\n}];\nvar dashboardNav = [{\n  name: 'Logout',\n  href: '/',\n  current: true\n}];//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/utlis/utils.js\n");

